NotificationArn.Description:
The Alibaba Cloud Resource Name (ARN) of the notification target that Auto Scaling will use to notify you when an instance is in the transition state for the lifecycle hook. This target can be either an MNS queue or an MNS topic. The format of the parameter value is acs:ess:{region}:{account-id}:{resource-relative-id}.
region: the region to which the scaling group locates
account-id: Alibaba Cloud ID
For example:
MNS queue: acs:ess:{region}:{account-id}:queue/{queuename}
MNS topic: acs:ess:{region}:{account-id}:topic/{topicname}
OOS template: acs:ess:{region}:{account-id}:oos/{templatename}

Endpoint.Description:
Terminal address of the message recipient for the created subscription.
Currently, four types of endpoints are supported: 
1. HttpEndpoint, which must be prefixed with "http://"; 
2. QueueEndpoint, in the format of acs:mns:{REGION}:{AccountID}:queues/{QueueName}; 
3. MailEndpoint, in the format of mail:directmail:{MailAddress}; 
4. SmsEndpoint, in the format of sms:directsms:anonymous or sms:directsms:{Phone}.

SwitchId.Description:
The ID of the user switch, optional parameter
When the parameter value is empty, the system will automatically select the appropriate switch according to the inventory situation;
You can also specify the switch ID yourself.

ExtendedCIDRs.Description:
Expansion network segment
When the switch ID is empty, this parameter can not be provided, and the system will automatically obtain all network segments under the VPC;
When the switch ID is not empty, this parameter must be provided. It is recommended to fill in all the network segments under the VPC.

Collate.Description:
A locale setting that specifies the collation for newly created databases.
The locale must be compatible with the character set set by the CharacterSetName parameter.When the cluster is PolarDB PostgreSQL (compatible with Oracle) or PolarDB PostgreSQL, this parameter is required; 
when the cluster is PolarDB MySQL, this parameter is not supported.

Mode.Description:
The mode selected when creating the database. The values are as follows:
- **auto**: The database in this mode supports automatic partitioning, that is, you do not need to specify a partition key when creating a table;
- **drds**: databases in this mode do not support automatic partitioning. When creating tables, you must use the dedicated database Shard syntax and specify the database shard key.

